function Quiz(questions) {
    this.score = 0;
    this.questions = questions;
    this.questionIndex = 0;
}
 
Quiz.prototype.getQuestionIndex = function() {
    return this.questions[this.questionIndex];
}
 
Quiz.prototype.guess = function(answer) {
    if(this.getQuestionIndex().isCorrectAnswer(answer)) {
        this.score++;
    }
 
    this.questionIndex++;
}
 
Quiz.prototype.isEnded = function() {
    return this.questionIndex === this.questions.length;
}
 
 
function Question(text, choices, answer) {
    this.text = text;
    this.choices = choices;
    this.answer = answer;
}
 
Question.prototype.isCorrectAnswer = function(choice) {
    return this.answer === choice;
}
 
 
function populate() {
    if(quiz.isEnded()) {
        showScores();
    }
    else {
        // show question
        var element = document.getElementById("question");
        element.innerHTML = quiz.getQuestionIndex().text;
 
        // show options
        var choices = quiz.getQuestionIndex().choices;
        for(var i = 0; i < choices.length; i++) {
            var element = document.getElementById("choice" + i);
            element.innerHTML = choices[i];
            guess("btn" + i, choices[i]);
        }
 
        showProgress();
    }
};
 
function guess(id, guess) {
    var button = document.getElementById(id);
    button.onclick = function() {
        quiz.guess(guess);
        populate();
    }
};
 
 
function showProgress() {
    var currentQuestionNumber = quiz.questionIndex + 1;
    var element = document.getElementById("progress");
    element.innerHTML = "Question " + currentQuestionNumber + " of " + quiz.questions.length;
};
 
function showScores() {
    var gameOverHTML = "";
    gameOverHTML += "<h2 id='score'> Your score: " + quiz.score + "</h2>";
    var element = document.getElementById("quiz");
    element.innerHTML = gameOverHTML;
    var playerName=FBInstant.player.getName();
    console.log('playerName');
    addToLeaderBoard(quiz.score, playerName);
    console.log('addToLeaderBoard called');
    updateLeaderBoard();
    console.log('updateLeaderBoard called');
    readLeaderBoard();
    console.log('readLeaderBoard called');
    
    $('#leaderboard-section').removeClass('hidden');
};

function addToLeaderBoard(scores, playerName) {
    FBInstant
  .getLeaderboardAsync('Global leaderboard')
  .then(leaderboard => {
    console.log(leaderboard.getName());
    return leaderboard.setScoreAsync(scores);
  })
  .then(() => console.log('Score saved'))
  .catch(error => console.error(error));
}

function updateLeaderBoard() {
    FBInstant.updateAsync({
      action: 'LEADERBOARD',
      name: 'Global leaderboard'
})
  .then(() => console.log('Update Posted'))
  .catch(error => console.error(error));
}

